import { Routes, Route } from "react-router-dom";
import Bookings from "./pages/Bookings";
import Home from "./pages/Home";
import "./style.css";
import Navbar from "./components/Navbar";
import BookingsContextProvider from "./Context/BookingsContextProvider";
import SlotsContextProvider from "./Context/SlotsContextProvider";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route
          path="/"
          Component={() => {
            return (
              <>
                <Home />
              </>
            );
          }}
        ></Route>
        <Route
          path="/bookings"
          Component={() => {
            return (
              <>
                <Bookings />
              </>
            );
          }}
        ></Route>
      </Routes>
    </div>
  );
}

export default App;
